@import url('https://fonts.googleapis.com/css2?family=Roboto:wght@400;500&display=swap');

.boton {
    display: flex;
    flex-direction: row;
    justify-content: center;
    align-items: center;
    padding: 12px 24px;
    gap: 8px;

    border-radius: 8px;

    min-width: 79px;
    height: 48px;

    flex: none;
    order: 0;
    flex-grow: 0;
    
    font-family: 'Roboto', sans-serif;
    font-style: normal;
    font-weight: 500;
    font-size: 16rem 1.500rem;
    line-height: 24px;

    color: #FFFFFF;

    text-align: center;
}

.boton { cursor:pointer; }

.H1Regular {
    font-weight: 400;
    font-size: 2rem;
    line-height: 40px;
}

.H1Medium {
    font-size: 2rem;
    line-height: 40px;
}

.H2Regular {
    font-weight: 400;
    font-size: 1.500rem;
    line-height: 32px;
}

.H2Medium {
    font-size: 1.500rem;
