    line-height: 22px;
}

.H5Medium {
    font-size: 0.875rem;
    line-height: 22px;
}

.H6Regular {
    font-weight: 400;
    font-size: 0.750rem;
    line-height: 12px;
}

.H6Medium {
    font-size: 0.750rem;
    line-height: 12px;
}

.principalHB {
    background: #F37320;
    border: none;
}


.principalHB:hover {
    background: #FE9552;
}

.secundarioHB {
