.secundarioOB:hover {
    border:solid #00AB8E;
    color: #00AB8E;
}

.terciarioOB {
    background: transparent;
    border: none;
    color: #06CA75;
}

.terciarioOB:hover {
    color: #00AB8E;
}

.secundarioOB:hover .source , .terciarioOB:hover .source {
    content:url("/assets/imagenes/iconodownloadverdehover.svg");
}

.principalOff {
